export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p>{`Pycograph is an open source tool that creates a RedisGraph model of your Python code. The tool lets you to explore your Python codebase with graph queries. With Pycograph, you can query the python code with Cypher. Additionally, it is possible to visualize the graph model using RedisInsight.`}</p>
    <p>{`The project is hosted over `}<a parentName="p" {...{
        "href": "https://pycograph.com/"
      }}>{`https://pycograph.com/`}</a>{` and package is available in `}<a parentName="p" {...{
        "href": "https://pypi.org/project/pycograph/"
      }}>{`PyPI repository`}</a>{`. It was introduced for the first time by `}<a parentName="p" {...{
        "href": "https://pypi.org/user/reka/"
      }}>{`Reka Horvath`}</a>{` during RedisConf 2021.`}</p>
    <div class="text--center">
      <iframe width="560" height="315" src="https://www.youtube.com/embed/pE3cg6jK2Zg" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
    </div>
    <p>{`Let us see how to explore Python code using Pycograph and RedisGraph below:`}</p>
    <h3 {...{
      "id": "step-1-install-docker"
    }}>{`Step 1. Install Docker`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` curl -sSL https://get.docker.com/ | sh
`}</code></pre>
    <h3 {...{
      "id": "step-2-install-pycograph-from-pypi"
    }}>{`Step 2. Install Pycograph from PyPI`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` pip install pycograph
`}</code></pre>
    <h3 {...{
      "id": "step-3-start-redisgraph-module"
    }}>{`Step 3. Start RedisGraph Module`}</h3>
    <p>{`The redislabs/redismod Docker image provides you all the essential Redis modules.`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` docker run -d -p 6379:6379 redislabs/redismod
`}</code></pre>
    <h3 {...{
      "id": "step-4-run-redisinsight"
    }}>{`Step 4. Run RedisInsight`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` docker run -d -v redisinsight:/db -p 8001:8001 redislabs/redisinsight:latest
`}</code></pre>
    <h3 {...{
      "id": "step-5-load-a-sample-python-code"
    }}>{`Step 5. Load a sample Python code`}</h3>
    <p>{`We will be using a popular Docker compose project for our sample python code.
Clone the Docker Compose project repository`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{`  git clone https://github.com/docker/compose
`}</code></pre>
    <h3 {...{
      "id": "step-6-load-python-code"
    }}>{`Step 6. Load Python Code`}</h3>
    <p>{`Load your project's code with the pycograph load command:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` pycograph load --project-dir compose
`}</code></pre>
    <b>Results</b>: 
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` Graph successfully updated.
 {'graph name': 'compose', 'nodes added': 2428, 'edges added': 11239}
`}</code></pre>
    <h3 {...{
      "id": "step-7-visualize-the-project"
    }}>{`Step 7. Visualize the project`}</h3>
    <p>{`Open RedisInsight, select RedisGraph on the left menu and run the below query:`}</p>
    <h4 {...{
      "id": "query-1-return-every-node"
    }}>{`Query #1: Return every node`}</h4>
    <pre><code parentName="pre" {...{}}>{` MATCH (n) RETURN n
`}</code></pre>
    <p>{`You will see the below output:`}</p>
    <p><img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./pycograph1.png").default} /></p>
    <h4 {...{
      "id": "query-2-return-every-non-test-object"
    }}>{`Query #2: Return every non-test object`}</h4>
    <p><img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./pycograph2.png").default} />{`  `}</p>
    <h4 {...{
      "id": "query-3--displaying-the-function-behind-the-docker-compose-up-command"
    }}>{`Query #3.  Displaying the function behind the docker-compose up command`}</h4>
    <p>{`A query returning exactly one node using the unique full_name property. Double-click on the node to display all its relationships.`}</p>
    <p><img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./pycograph3.png").default} /></p>
    <h4 {...{
      "id": "query-4-displaying-the-docker-compose-up-and-its-calls-relationships"
    }}>{`Query #4. Displaying the 'docker-compose up' and its calls relationships`}</h4>
    <p><img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./pycograph4.png").default} />{` `}</p>
    <h4 {...{
      "id": "query-5-displaying-the-docker-compose-up-vs-docker-compose-run"
    }}>{`Query #5. Displaying the 'docker-compose up' vs 'docker-compose run'`}</h4>
    <p>{`Functions called by the Docker Compose top level commands up and run`}</p>
    <p><img alt={"My Image"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./pycograph5.png").default} /></p>
    <h3 {...{
      "id": "references"
    }}>{`References:`}</h3>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://pycograph.com/"
        }}>{`Pycograph Project`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "https://github.com/docker/compose"
        }}>{`Docker Compose Source Code`}</a></li>
    </ul>
    </MDXLayout>;
}

;
